import React, { useState } from 'react';
import '../CSS/Product.css';
import 'bootstrap/dist/css/bootstrap.min.css'; 
import { Container, Row, Col, Image, Button } from 'react-bootstrap'; 
import Authuse from '../Components/Auth';
import { useNavigate } from 'react-router-dom';

const toysData = [
  // toy data here...
];

const AsideComponents = () => {
    const auth = Authuse();
    const navigate = useNavigate();

    const [cart, setCart] = useState([]);
    const [showCart, setShowCart] = useState(false);
    const [orderPlaced, setOrderPlaced] = useState(false);

    const addToCart = (toy) => {
        setCart([...cart, toy]);
    };

    const removeFromCart = (id) => setCart(cart.filter(item => item.id !== id));
    const toggleCart = () => setShowCart(!showCart);
    const placeOrder = () => {
        setCart([]);
        setOrderPlaced(true);
    };
    const totalPrice = cart.reduce((acc, item) => acc + item.price, 0);

    let handleAddToCart;
    if (auth.username) {
        handleAddToCart = (toy) => {
            addToCart(toy);
        };
    } else {
        handleAddToCart = () => {
            navigate('/login');
        };
    }

    return (
        <Container>
            <Row>
                {toysData.map(toy => (
                    <Col key={toy.id} xs={12} sm={6} md={4} lg={3}>
                        <div className="toy-item">
                            <h3>{toy.title}</h3>
                            <Image src={toy.image} alt={toy.title} fluid className="toy-image"/>
                            <p>${toy.price}</p>
                            <Button onClick={() => handleAddToCart(toy)}>Add to Cart</Button>
                        </div>
                    </Col>
                ))}
            </Row>
            {auth.username && (
                <>
                    <Row className="mt-5">
                        <Col>
                            <div className="shopping-cart">
                                <h2>Shopping Cart</h2>
                                <table className="table">
                                    <thead>
                                        <tr>
                                            <th>Item</th>
                                            <th>Price</th>
                                            <th>Action</th>
                                        </tr>
                                    </thead>
                                    <tbody>
                                        {cart.map(item => (
                                            <tr key={item.id}>
                                                <td>{item.title}</td>
                                                <td>${item.price}</td>
                                                <td className="cart-buttons">
                                                    <Button onClick={() => removeFromCart(item.id)} variant="danger">Remove</Button>
                                                </td>
                                            </tr>
                                        ))}
                                    </tbody>
                                </table>
                                <p>Total Price: ${totalPrice}</p>
                                <Button onClick={placeOrder}>Place Order</Button>
                            </div>
                        </Col>
                    </Row>
                    {orderPlaced && (
                        <Row className="mt-3">
                            <Col>
                                <p>Thank you for your order!</p>
                            </Col>
                        </Row>
                    )}
                </>
            )}
            <Row className="mt-3">
                <Col>
                    <Button onClick={toggleCart}>{showCart ? 'Hide Cart' : 'Show Cart'}</Button>
                </Col>
            </Row>
        </Container>
    );
};

export default AsideComponents;
